def areMotifsEqual(motif1,motif2):
	assert len(motif1) == len(motif2)
	for idx in range(len(motif1)):
		if motif1[idx] == 'N' or motif2[idx] == 'N':
			pass
		elif motif1[idx] == motif2[idx]:
			pass
		else:
			return False
	return True

def scanForGuides(toScan,guidelength=20,motif='NGG'):
	assert len(toScan) > guidelength
	guides = []
	for i in range(len(toScan)-guidelength-len(motif)+1):
		#print toScan[i+guidelength:i+guidelength+len(motif)]
		if areMotifsEqual(toScan[i+guidelength:i+guidelength+len(motif)],motif):
			guides.append(toScan[i:i+guidelength+len(motif)])
	return guides

def score_gtscan_output(guide,output_dict):
	offtargets = []
	for row in output_dict.values():
		offtargets.append(row[3])
	return score.aggregate_score(guide,offtargets)




def reverseComplement(nucleotides):
	revCompDict = {
	'A' : 'T',
	'T' : 'A',
	'G' : 'C',
	'C' : 'G',
	'a' : 't',
	't' : ''
	}

class RawSequence(object):

	def __init__(self, sequence_string, motif='NGG', guidelength=20, genome='GCA_000001405.15_GRCh38_no_alt_analysis_set'):
		self.sequence = sequence_string
		self.revcomp = gt.Seq(sequence_string,gt.generic_dna).reverse_complement().tostring()
		self.motif = motif
		self.guidelength = guidelength
		self.genome = genome

	def __str__(self):
		return 'F: '+self.sequence+' R: '+self.revcomp

	def __find_potential_guides(self):
		self.forward_guides = scanForGuides(self.sequence,self.guidelength,self.motif)
		self.reverse_guides = scanForGuides(self.revcomp,self.guidelength,self.motif)

	def __find_offtarget(self,guide):
		return gtp.find_offtargets(guide,self.genome)

	def __score_individual(self, guide, gtscan_output):
		return score_gtscan_output(guide,gtscan_output)

	def score_all(self):
		f_scores = []
		r_scores = []
		self.__find_potential_guides()
		for guide in self.forward_guides:
			gtscan_output = self.__find_offtarget(guide)
			score = self.__score_individual(guide,gtscan_output)
			f_scores.append([guide,gtscan_output,score])
		for guide in self.reverse_guides:
			gtscan_output = self.__find_offtarget(guide)
			score = self.__score_individual(guide,gtscan_output)
			r_scores.append([guide,gtscan_output,score])
		return f_scores.extend(r_scores)


